import Rating from "./ratings"
function Feedbacklist({feed}) {

    if(!feed || feed.length===0){
        <p>no feedback received</p>
    }

    //the map function iterates over the array feed which is actually a prop on Feedbacklist and it makes a new div for each items rating in array
  return (
    <div className="feedback-list">
    
    {feed.map((item)=>(

        <div>{item.rating}</div>


    ))}
    
    </div>
  )
}

export default Feedbacklist
